INSERT INTO `seller_master` VALUES ('81', '0', '2017-11-20 10:04:57', '125.99.161.26', '8', '22', 'Mohit', 'Beragi', '1', 'kclub', '0', 'hhd', '7995', '21', '101', '452018', 'shfsgn;siehgsfsdgsdgf', 'fff999444', '9898558', null, 'shoppy.zip.zap@gmail.in', '9754444463', '', 'unique');
INSERT INTO `seller_master` VALUES ('82', '0', '2017-11-24 13:54:58', '27.7.251.174', '12', '12', 'Amaya', 'soni', '1', 'Amaya Creation', '0', 'Bhopal', '7911', '21', '101', '564748', '3365362537573', '354667778848', '4355266627', null, 'creation.amaya@info.in', '67675849653', '', 'There are three responses to a piece of design  yes, no, and WOW! Wow is the one to aim for.');
INSERT INTO `seller_master` VALUES ('84', '0', '2017-11-24 14:13:40', '27.7.251.174', '14', '14', 'namrata', 'kela', '1', 'CRECIVA DESIGNER', '0', 'Ahmedabad ', '6549', '12', '101', '435678', '76643542653365', '1232325367', '120934765', null, 'designer.creciva@gmail.in', '2343456765', '', 'It is not enough that we build products that function, that are understandable and usable, we also need to build products that bring joy and excitement, pleasure and fun, and, yes, beauty to peoples lives.');
INSERT INTO `seller_master` VALUES ('85', '0', '2017-11-24 15:49:02', '27.7.251.174', '', '16', 'prateeksha', 'joshi', '1', 'RAINBOW DESIGNER', '0', 'New delhi', '6473', '10', '101', '110002', null, null, null, null, 'designer.rainbow@info.com', '6578765490', '', 'The goal of a designer is to listen, observe, understand, sympathize, empathize, synthesize, and glean insights that enable him or her to make the invisible visible.');
INSERT INTO `seller_master` VALUES ('87', '0', '2017-11-24 16:28:46', '27.7.251.174', '', '18', 'karan', 'gupta', '1', 'CLASSY FASHION', '0', 'Indore', '7995', '21', '101', '452003', null, null, null, null, 'fashion.classy@gmail.com', '9897363425', '', 'If you do good work for good clients, it will lead to other good work for other good clients. If you do bad work for bad clients, it will lead to other bad work for other bad clients.');
INSERT INTO `seller_master` VALUES ('88', '0', '2017-11-24 16:34:31', '27.7.251.174', '', '19', 'Hetal', 'Ghare', '1', 'feminas creations  ', '0', 'Gujarat ', '0', '0', '101', '5347789', null, null, null, null, 'creations.feminas@gmail.in', '5682456780', '', 'Above all, think of life as a prototype. We can conduct experiments, make discoveries, and change our perspectives. We can look for opportunities to turn processes into projects that have tangible outcomes. We can learn how to take joy in the things we create whether they take the form of a fleeting experience or an heirloom that will last for generations. We can learn that reward comes in creation and re-creation, no just in the consumption of the world around us. Active participation in the process of creation is our right and our privilege. We can learn to measure the success of our ideas not by our bank accounts by their impact on the world.');
INSERT INTO `seller_master` VALUES ('89', '0', '2017-11-24 16:54:12', '27.7.251.174', '', '21', 'Hemant ', 'Kapoor', '1', 'OLIVIA FASHION', '0', 'ujjain', '8231', '21', '101', '456001', null, null, null, null, 'fashion.sanskriti@gmail.in', '8947364784', '', 'our comapany gives quality not quantity.');
INSERT INTO `seller_master` VALUES ('90', '0', '2017-11-24 16:55:34', '27.7.251.174', '', '23', 'mahima', 'parkh', '1', 'Sanskriti fashion', '0', 'Punjab', '0', '32', '101', '1298763', null, null, null, null, 'industries.tarlica@gmail.com', '4456578985', '', 'Theres the whole Buddhist thing about the essence of a bowl being its emptinessthats why its useful. Its emptiness allows it to hold something. I guess that means that design must talk about something else. If you make design about design, youre just stacking bowls, and thats not what bowls are for.');
INSERT INTO `seller_master` VALUES ('92', '0', '2017-11-24 17:20:51', '27.7.251.174', '', '33', 'sakshi ', 'bhalla', '1', 'TARLICA FASHION', '0', 'Ahmedabad', '6549', '12', '101', '52001', null, null, null, null, 'sakshi.b@gmail.com', '7868907654', '', 'tarlica is a brand which always believe on customer satisfaction');
INSERT INTO `seller_master` VALUES ('95', '0', '2017-11-24 18:11:07', '27.7.251.174', '', '20', 'avinash', 'surana', '1', 'ADRASHTI FASHION', '0', 'Madhya Pradesh ', '7980', '21', '101', '1298376', null, null, null, null, 'fashion.olivia@org.in', '9678345123', '', 'Here is one of the few effective keys to the design problem: the ability of the designer to recognize as many of the constraints as possible; his willingness and enthusiasm for working within these constraints');
